import GlobalHead from "./GlobalHead";
import Header from "./Header";

const styles = {
  width: "100%",
  maxWidth: "65rem",
  minHeight: "100vh",
}

const PageLayout = props => (
  <main style={styles}>
    <GlobalHead />
    <Header />
    {props.children}
  </main>
);

export default PageLayout;
